import YouTubeComp from '../../component/YouTubeComp/YouTubeComp';
import Product from '../Product/Product';

class Home extends Component {
    render(){

        return(
            <div>
                <p>Props Materi</p>

                <hr></hr>
                <YouTubeComp 
                time="11.19" 
                title="Tutorail 1"   
                desc="3 Jam lalu"/>   
                
                <YouTubeComp  
                time='9.10' 
                title="Tutorail 1"   
                desc="2 Jam lalu"/>    
                
                <YouTubeComp  
                time="10.10" 
                title="Tutorail 1"  
                desc="10 Jam lalu"/>    
                
                <YouTubeComp  />    
            </div>
          
           )
    }                                                                                                                                                                                                                                                               
}

export default Home;
